import React from "react";
import { Form } from "react-bootstrap";
import Result from "./"
const main = () => {
  return (
    <div>
      <Form style={{ width: "25%" }}>
        <Form.Group controlId="formBasic">
          <Form.Control type="text" placeholder="find a food" />
        </Form.Group>
      </Form>
      <Result />
    </div>
  );
};

export default main;
